<body>
    <script src="flutter_bootstrap.js" async></script>
    <script>
        window.addEventListener('load', function () {
            _flutter.loader.load({
                // The new load() method now takes a configuration object.
                serviceWorker: {
                    // Use the template token for the service worker version.
                    serviceWorkerVersion: '"818065854"',
                }
            }).then(function (engineInitializer) {
                // Once the engine is initialized, you can configure it before running the app.
                return engineInitializer.initializeEngine();
            }).then(function (appRunner) {
                // Finally, run the app.
                appRunner.runApp();
            });
        });
    </script>
